        sourcesContent: ["@import 'common/styles/variables.scss';\n\n.components-xman-overlay {\n  z-index: $z-xman-dialog;\n\n  .components-modal-dialog {\n    padding: 0;\n\n    .dialog-btn-close {\n      top: 22px;\n      right: 22px;\n    }\n\n    &.mobile {\n      .dialog-btn-close {\n        top: 15px;\n        right: 15px;\n        font-size: 18px;\n        color: $color-text;\n      }\n    }\n  }\n}\n\n.components-xman-popover {\n  display: flex;\n  width: 706px;\n  overflow: hidden;\n  background-color: #fff;\n  border-radius: 8px;\n\n  .other-platform {\n    display: flex;\n    justify-content: center;\n\n    .btn-login {\n      flex: 1;\n    }\n  }\n\n  &.desktop {\n    display: flex;\n    height: 464px;\n\n    .left-banner {\n      display: flex;\n      flex: 0 0 302px;\n    }\n\n    .main-box {\n      flex: auto;\n      padding: 41px 60px 0;\n    }\n\n    .btn-login-facebook {\n      margin: 40px 0 16px;\n    }\n\n    .btn-login-google {\n      margin-bottom: 22px;\n\n      .icon {\n        width: 19px;\n        height: 19px;\n      }\n    }\n\n    .divider-box {\n      span {\n        color: $color-disable;\n      }\n    }\n\n    .other-platform {\n      margin: 14px 0 40px;\n    }\n  }\n\n  // protrait mobile\n  &.mobile {\n    flex-direction: column;\n    width: $mobile-modal-width;\n\n    .top-banner {\n      height: 130px;\n    }\n\n    .main-box {\n      padding: 32px 35px;\n      padding-bottom: 20px;\n\n      .btn-login-facebook {\n        margin-bottom: 20px;\n      }\n\n      .other-platform {\n        margin: 14px 0 20px;\n\n        img.icon {\n          width: 45px;\n          height: 45px;\n        }\n      }\n\n      .login-policy {\n        text-align: center;\n      }\n    }\n\n    .divider-box {\n      span {\n        color: rgba(#16181a, .7);\n      }\n    }\n  }\n\n  .main-box {\n    .login-title {\n      margin-bottom: 8px;\n      font-size: 24px;\n      font-weight: 600;\n      color: $color-text;\n    }\n\n    .login-subtitle {\n      color: $color-text-secondary;\n    }\n\n    .btn-login-facebook .components-button {\n      color: #fff;\n      background-image: linear-gradient(90deg, #2a87ff 0%, #1877f2 100%);\n    }\n\n    .btn-login-google .components-button {\n      font-weight: 600;\n      color: $color-text;\n      border: 1px solid rgba(230, 231, 236, 1);\n      border-radius: 24px;\n    }\n\n    .divider-box {\n      display: flex;\n      align-items: center;\n\n      .divider {\n        flex: auto;\n        height: 1px;\n        background-color: $color-border;\n      }\n\n      span {\n        flex: none;\n        margin: 0 14px;\n      }\n    }\n\n    .other-platform {\n      .btn-login {\n        text-align: center;\n        cursor: pointer;\n      }\n\n      img.icon {\n        width: 50px;\n        height: 50px;\n      }\n    }\n\n    .login-policy {\n      font-size: 12px;\n      color: rgba($color: $color-text-secondary, $alpha: .5);\n\n      a {\n        color: $color-text-secondary;\n      }\n    }\n  }\n}\n\n//landscape mobile\n.landscape-mode {\n  .components-xman-overlay .components-modal.components-modal-dialog {\n    &.mobile {\n      width: 263px;\n    }\n  }\n\n  .components-xman-popover {\n    &.mobile {\n      width: 263px;\n\n      .top-banner {\n        height: 107px;\n      }\n\n      .main-box {\n        padding: 30px 25px 25px;\n\n        .btn-login-facebook {\n          margin-bottom: 11px;\n\n          .components-button {\n            height: 34px;\n            font-size: 13px;\n          }\n\n          .components-icon-facebook {\n            font-size: 12px;\n          }\n\n          .button-icon {\n            margin-right: 5px;\n          }\n        }\n\n        .other-platform {\n          margin: 11px 20px;\n\n          img.icon {\n            width: 30px;\n            height: 30px;\n          }\n        }\n\n        .login-policy {\n          font-size: 8px;\n          line-height: 12px;\n          text-align: center;\n        }\n      }\n\n      .divider-box {\n        span {\n          font-size: 8px;\n        }\n      }\n    }\n  }\n}\n\n.dark-mode {\n  .components-xman-popover {\n    background-color: $dm-color-modal-bg;\n\n    &.desktop {\n      .divider-box {\n        span {\n          color: $dm-color-text-secondary;\n        }\n      }\n    }\n\n    &.mobile {\n      .main-box {\n        padding: 32px 35px;\n        padding-bottom: 20px;\n\n        .btn-login-facebook {\n          margin-bottom: 20px;\n        }\n\n        .other-platform {\n          margin: 14px 0 20px;\n\n          img.icon {\n            width: 45px;\n            height: 45px;\n          }\n        }\n\n        .login-policy {\n          text-align: center;\n        }\n      }\n\n      .divider-box {\n        span {\n          color: $dm-color-text-secondary;\n        }\n      }\n    }\n\n    .main-box {\n      .login-title {\n        color: $dm-color-text;\n      }\n\n      .login-subtitle {\n        color: $dm-color-text-secondary;\n      }\n\n      .btn-login-google .components-button {\n        color: $dm-color-text;\n        border: none;\n      }\n\n      .divider-box {\n        .divider {\n          background-color: $dm-color-border-light;\n        }\n      }\n\n      .login-policy {\n        color: rgba($dm-color-text-secondary, .5);\n\n        a {\n          color: $dm-color-text-secondary;\n        }\n      }\n    }\n  }\n}\n", "// light mode\n// color\n$color-primary: #ffba00;\n$color-text: #16181a;\n$color-text-secondary: rgba($color-text, .45);\n$color-disable: #c6cbd8;\n$color-border: #edeff7;\n$color-red: #ef3d48;\n$color-success: #16bc8b;\n\n// gradient\n$gradient-yellow: linear-gradient(265deg, #ffa900 0%, #ffba00 100%);\n$gradient-red: linear-gradient(-180deg, #ff4d58 0%, #e5202c 100%);\n\n// font\n$font-amount: 'Agency FB', 'Open Sans';\n$font-agency-fb: 'Agency FB', 'Open Sans', amiri, arial, helvetica, 'Droid Sans', system-ui, -apple-system, blinkmacsystemfont, 'Helvetica Neue', sans-serif;\n\n// z-index\n$z-report-dialog: 3000;\n$z-staff-dialog: 3000;\n$z-playback-panel-more-popover: 1002;\n$z-xman-dialog: 2000;\n$z-toast: 1002;\n$z-dialog: 1001;\n$z-popover: 1000;\n$z-spinner: 999;\n$z-dropdown-popover: 998;\n$z-side-nav: 200;\n$z-video-poster-tag: 100;\n$z-header: 997;\n\n// width\n$mobile-modal-width: 310px; //iphone5 and motoG4 width is 320, 10px margin\n$content-max-width: 1200px;\n$content-min-width: 1024px;\n\n// dark mode\n// https://app.sympli.io/app#!/designs/6081507cf475fb47060cf69e/specs/assets\n// color\n$dm-color-text: #e8e8f0;\n$dm-color-text-secondary: #adadba;\n$dm-color-border: #242428;\n$dm-color-border-light: #47474a;\n$dm-color-icon: #5e5e68;\n$dm-color-popover-icon: #81818d;\n$dm-color-button-disabled: rgba(#fff, .25);\n$dm-color-scrollbar: #404046;\n\n// bg colors\n$dm-color-bg-1: #101012; // most dark\n$dm-color-bg-2: #19191d;\n$dm-color-modal-bg: #1e1e25;\n$dm-color-input-bg: #25252b;\n$dm-color-modal-input-bg: #292930;\n$dm-color-button-bg: #303034;\n$dm-color-button-hover-bg: #38383e; // least dark\n$dm-color-button-disabled-bg: #26262b;\n\n// box-shadow\n$dm-box-shadow-modal: 0 0 48px 0 rgba(#000, .11);\n"]
