        sourcesContent: ["@import 'common/styles/variables.scss';\n\n.desktop-header {\n  display: flex;\n  align-items: center;\n  height: 100%;\n  padding: 0 20px;\n  background-color: $color-text;\n\n  .logo {\n    position: relative;\n    display: flex;\n    flex: 0 0 100px;\n\n    .beta {\n      position: absolute;\n      top: 0;\n      right: -29px;\n      width: 29px;\n      height: 23px;\n    }\n\n    img {\n      align-self: center;\n    }\n  }\n\n  .header-center {\n    position: relative;\n    display: flex;\n    flex: auto;\n    align-items: center;\n    justify-content: center;\n    min-width: 660px;\n\n    nav {\n      ul {\n        display: flex;\n        align-items: center;\n        justify-content: center;\n\n        li a {\n          position: relative;\n          display: block;\n          height: 60px;\n          padding: 0 55px;\n          font-size: 14px;\n          font-weight: 600;\n          line-height: 60px;\n          color: #fff;\n          opacity: .8;\n          transition: color .3s, opacity .3s;\n        }\n\n        li:hover a {\n          color: $color-primary;\n          opacity: 1;\n        }\n\n        li.current a {\n          color: $color-primary;\n          opacity: 1;\n\n          &::before {\n            position: absolute;\n            top: 0;\n            right: 20px;\n            bottom: 0;\n            left: 20px;\n            content: ' ';\n            background-image: linear-gradient(180deg, rgba(255, 191, 17, 0) 0%, $color-primary 100%);\n            opacity: .27;\n            transform: skewX(-34deg);\n          }\n\n          &::after {\n            position: absolute;\n            right: 40px;\n            bottom: 0;\n            left: 0;\n            height: 3px;\n            content: ' ';\n            background-color: $color-primary;\n            transform: skewX(-34deg);\n          }\n        }\n\n        @media screen and (max-width: 1200px) {\n          li a {\n            padding: 0 35px;\n            white-space: nowrap;\n          }\n\n          li.current a {\n            &::before {\n              right: 10px;\n              left: 10px;\n            }\n\n            &::after {\n              right: 30px;\n              left: -10px;\n            }\n          }\n        }\n      }\n    }\n  }\n\n  .views-headers-i18n-switcher,\n  .views-headers-tutorial-menu,\n  .views-headers-notification-menu {\n    margin-right: 30px;\n    cursor: pointer;\n    opacity: .8;\n    transition: opacity .3s;\n\n    &:hover {\n      opacity: 1;\n    }\n  }\n\n  &.transparent {\n    background-color: transparent;\n  }\n}\n", "// light mode\n// color\n$color-primary: #ffba00;\n$color-text: #16181a;\n$color-text-secondary: rgba($color-text, .45);\n$color-disable: #c6cbd8;\n$color-border: #edeff7;\n$color-red: #ef3d48;\n$color-success: #16bc8b;\n\n// gradient\n$gradient-yellow: linear-gradient(265deg, #ffa900 0%, #ffba00 100%);\n$gradient-red: linear-gradient(-180deg, #ff4d58 0%, #e5202c 100%);\n\n// font\n$font-amount: 'Agency FB', 'Open Sans';\n$font-agency-fb: 'Agency FB', 'Open Sans', amiri, arial, helvetica, 'Droid Sans', system-ui, -apple-system, blinkmacsystemfont, 'Helvetica Neue', sans-serif;\n\n// z-index\n$z-report-dialog: 3000;\n$z-staff-dialog: 3000;\n$z-playback-panel-more-popover: 1002;\n$z-xman-dialog: 2000;\n$z-toast: 1002;\n$z-dialog: 1001;\n$z-popover: 1000;\n$z-spinner: 999;\n$z-dropdown-popover: 998;\n$z-side-nav: 200;\n$z-video-poster-tag: 100;\n$z-header: 997;\n\n// width\n$mobile-modal-width: 310px; //iphone5 and motoG4 width is 320, 10px margin\n$content-max-width: 1200px;\n$content-min-width: 1024px;\n\n// dark mode\n// https://app.sympli.io/app#!/designs/6081507cf475fb47060cf69e/specs/assets\n// color\n$dm-color-text: #e8e8f0;\n$dm-color-text-secondary: #adadba;\n$dm-color-border: #242428;\n$dm-color-border-light: #47474a;\n$dm-color-icon: #5e5e68;\n$dm-color-popover-icon: #81818d;\n$dm-color-button-disabled: rgba(#fff, .25);\n$dm-color-scrollbar: #404046;\n\n// bg colors\n$dm-color-bg-1: #101012; // most dark\n$dm-color-bg-2: #19191d;\n$dm-color-modal-bg: #1e1e25;\n$dm-color-input-bg: #25252b;\n$dm-color-modal-input-bg: #292930;\n$dm-color-button-bg: #303034;\n$dm-color-button-hover-bg: #38383e; // least dark\n$dm-color-button-disabled-bg: #26262b;\n\n// box-shadow\n$dm-box-shadow-modal: 0 0 48px 0 rgba(#000, .11);\n"]
