        sourcesContent: ["@import 'common/styles/variables.scss';\n@import 'common/styles/mixins.scss';\n\n.components-tabs {\n  overflow-x: auto;\n  overflow-y: hidden;\n  scroll-behavior: smooth;\n\n  .tab-label {\n    color: #757575;\n    white-space: pre;\n    cursor: pointer;\n    transition: color .3s, opacity .3s;\n\n    &:hover {\n      color: $color-text;\n      opacity: 1;\n    }\n  }\n\n  &.theme-tab {\n    display: flex;\n    align-items: stretch;\n    width: 100%;\n    margin: 0 auto;\n\n    .tab-label {\n      padding: 18px 30px;\n      font-weight: 600;\n\n      &.tab-current {\n        position: relative;\n        color: $color-text;\n        opacity: 1;\n\n        &::after {\n          position: absolute;\n          right: 30px;\n          bottom: 0;\n          left: 30px;\n          height: 3px;\n          content: ' ';\n          background-color: $color-primary;\n          border-top-left-radius: 3px;\n          border-top-right-radius: 3px;\n        }\n      }\n\n      &:first-child {\n        padding-left: 0;\n\n        &::after {\n          left: 0;\n        }\n      }\n    }\n\n    &.has-bottom-border {\n      border-bottom: 1px solid #eee;\n\n      .tab-label.tab-current::after {\n        bottom: -1px;\n      }\n    }\n\n    &.size-small {\n      font-size: 14px;\n      line-height: 18px;\n\n      .tab-label {\n        padding-top: 13px;\n        padding-bottom: 13px;\n      }\n    }\n\n    &.size-normal {\n      font-size: 14px;\n      line-height: 18px;\n\n      &.mobile {\n        font-size: 15px;\n        line-height: 18px;\n\n        .tab-label {\n          padding: 11px 20px;\n\n          &.tab-current::after {\n            bottom: 0;\n            left: 50%;\n            width: 50px;\n            border-radius: 6px;\n            transform: translateX(-50%);\n          }\n        }\n      }\n    }\n\n    &.size-big {\n      font-size: 18px;\n      line-height: 24px;\n\n      .tab-label {\n        padding: 13px 35px;\n\n        &::after {\n          right: 35px;\n          left: 35px;\n        }\n\n        &:first-child {\n          padding-left: 0;\n\n          &::after {\n            left: 0;\n          }\n        }\n      }\n    }\n\n    &.align-start {\n      justify-content: flex-start;\n    }\n\n    &.align-evenly {\n      justify-content: space-evenly;\n\n      .tab-label {\n        padding-right: 0;\n        padding-left: 0;\n\n        &::after {\n          right: 0;\n          left: 0;\n        }\n      }\n    }\n\n    &.align-space-around {\n      justify-content: space-around;\n\n      .tab-label {\n        padding-right: 0;\n        padding-left: 0;\n\n        &::after {\n          right: 0;\n          left: 0;\n        }\n      }\n    }\n  }\n\n  &.theme-capsule {\n    display: flex;\n    margin-bottom: 18px;\n\n    .tab-label {\n      box-sizing: border-box;\n      display: flex;\n      align-items: center;\n      justify-content: center;\n      min-width: 72px;\n      padding: 5px 16px;\n      margin-right: 12px;\n      font-size: 12px;\n      line-height: 18px;\n      color: $color-text;\n      background-color: #fff;\n      border: 1px solid $color-border;\n      border-radius: 36px;\n      transition: border-color .2s;\n\n      &:last-child {\n        margin-right: 0;\n      }\n\n      .divider {\n        width: 1px;\n        height: 8px;\n        margin: 0 6px;\n        background-color: rgba($color: #979797, $alpha: .5);\n      }\n\n      &.tab-current {\n        color: $color-text;\n        border-color: $color-primary;\n\n        .divider {\n          background-color: $color-text;\n        }\n      }\n\n      &:hover {\n        border-color: $color-primary;\n      }\n    }\n  }\n\n  &.theme-toggle {\n    display: inline-block;\n    padding: 3px;\n    background-color: #f2f2f6;\n    border-radius: 36px;\n\n    .tab-label {\n      box-sizing: border-box;\n      display: inline-block;\n      min-width: 80px;\n      padding: 6px 18px;\n      font-size: 12px;\n      line-height: 18px;\n      color: rgba(#28292f, .5);\n      text-align: center;\n\n      &.tab-current {\n        color: #e08400;\n        background-color: #fff;\n        border-radius: 36px;\n      }\n    }\n  }\n\n  &.theme-divider {\n    display: flex;\n\n    .tab-label {\n      position: relative;\n      padding: 0 10px;\n      color: $color-text-secondary;\n\n      &::after {\n        position: absolute;\n        top: 50%;\n        right: 0;\n        width: 1px;\n        height: 13px;\n        content: ' ';\n        background: #dadee9;\n        transform: translateY(-50%);\n      }\n\n      &:last-child {\n        &::after {\n          display: none;\n        }\n      }\n\n      &.tab-current {\n        color: $color-text;\n      }\n    }\n  }\n\n  &.mobile {\n    @include scrollbar(0);\n  }\n}\n\n.dark-mode {\n  .components-tabs {\n    .tab-label {\n      color: $dm-color-text-secondary;\n\n      &:hover {\n        color: $dm-color-text;\n      }\n    }\n\n    &.theme-tab {\n      .tab-label {\n        &.tab-current {\n          color: $dm-color-text;\n        }\n      }\n\n      &.has-bottom-border {\n        border-bottom: 1px solid $dm-color-border;\n      }\n    }\n\n    &.theme-capsule {\n      .tab-label {\n        color: $dm-color-text;\n        background-color: $dm-color-button-bg;\n        border-color: transparent;\n\n        .divider {\n          background-color: $dm-color-border-light;\n        }\n\n        &.tab-current {\n          color: $color-text;\n          background-color: $color-primary;\n\n          .divider {\n            background-color: rgba($color-text, .3);\n          }\n\n          &:hover {\n            background-color: $color-primary;\n          }\n        }\n\n        &:hover {\n          background-color: $dm-color-button-hover-bg;\n        }\n      }\n    }\n\n    &.theme-toggle {\n      background-color: $dm-color-input-bg;\n\n      .tab-label {\n        color: $dm-color-text-secondary;\n\n        &.tab-current {\n          color: $color-primary;\n          background-color: $dm-color-button-hover-bg;\n        }\n      }\n    }\n\n    &.theme-divider {\n      .tab-label {\n        color: $dm-color-text-secondary;\n\n        &::after {\n          background: $dm-color-border-light;\n        }\n\n        &.tab-current {\n          color: $dm-color-text;\n        }\n      }\n    }\n  }\n}\n", "// light mode\n// color\n$color-primary: #ffba00;\n$color-text: #16181a;\n$color-text-secondary: rgba($color-text, .45);\n$color-disable: #c6cbd8;\n$color-border: #edeff7;\n$color-red: #ef3d48;\n$color-success: #16bc8b;\n\n// gradient\n$gradient-yellow: linear-gradient(265deg, #ffa900 0%, #ffba00 100%);\n$gradient-red: linear-gradient(-180deg, #ff4d58 0%, #e5202c 100%);\n\n// font\n$font-amount: 'Agency FB', 'Open Sans';\n$font-agency-fb: 'Agency FB', 'Open Sans', amiri, arial, helvetica, 'Droid Sans', system-ui, -apple-system, blinkmacsystemfont, 'Helvetica Neue', sans-serif;\n\n// z-index\n$z-report-dialog: 3000;\n$z-staff-dialog: 3000;\n$z-playback-panel-more-popover: 1002;\n$z-xman-dialog: 2000;\n$z-toast: 1002;\n$z-dialog: 1001;\n$z-popover: 1000;\n$z-spinner: 999;\n$z-dropdown-popover: 998;\n$z-side-nav: 200;\n$z-video-poster-tag: 100;\n$z-header: 997;\n\n// width\n$mobile-modal-width: 310px; //iphone5 and motoG4 width is 320, 10px margin\n$content-max-width: 1200px;\n$content-min-width: 1024px;\n\n// dark mode\n// https://app.sympli.io/app#!/designs/6081507cf475fb47060cf69e/specs/assets\n// color\n$dm-color-text: #e8e8f0;\n$dm-color-text-secondary: #adadba;\n$dm-color-border: #242428;\n$dm-color-border-light: #47474a;\n$dm-color-icon: #5e5e68;\n$dm-color-popover-icon: #81818d;\n$dm-color-button-disabled: rgba(#fff, .25);\n$dm-color-scrollbar: #404046;\n\n// bg colors\n$dm-color-bg-1: #101012; // most dark\n$dm-color-bg-2: #19191d;\n$dm-color-modal-bg: #1e1e25;\n$dm-color-input-bg: #25252b;\n$dm-color-modal-input-bg: #292930;\n$dm-color-button-bg: #303034;\n$dm-color-button-hover-bg: #38383e; // least dark\n$dm-color-button-disabled-bg: #26262b;\n\n// box-shadow\n$dm-box-shadow-modal: 0 0 48px 0 rgba(#000, .11);\n", "@import 'common/styles/variables.scss';\n\n@mixin limit-content-width {\n  box-sizing: border-box;\n  width: 100%;\n  max-width: $content-max-width + 40;\n  padding-right: 20px;\n  padding-left: 20px;\n  margin: 0 auto;\n}\n\n@mixin flex-center {\n  display: flex;\n  align-items: center;\n  justify-content: center;\n}\n\n@mixin ellipsis {\n  overflow: hidden;\n  text-overflow: ellipsis;\n  white-space: nowrap;\n}\n\n@mixin ellipsis-flex-container {\n  min-width: 0;\n}\n\n@mixin block-ellipsis($lines: 2) {\n  display: -webkit-box;\n  overflow: hidden;\n  text-overflow: ellipsis;\n  white-space: normal;\n  -webkit-line-clamp: $lines;\n  // prevent this rule removed by autoprefixer\n  // see: https://github.com/postcss/autoprefixer/issues/776\n\n  /*! autoprefixer: off */\n  -webkit-box-orient: vertical;\n}\n\n@mixin align-center {\n  position: absolute;\n  top: 50%;\n  left: 50%;\n  transform: translate(-50%, -50%);\n}\n\n@mixin absolute-cover {\n  position: absolute;\n  top: 0;\n  right: 0;\n  bottom: 0;\n  left: 0;\n}\n\n@mixin scrollbar($size: 6px, $color: #d8d8db, $backgroundColor: transparent) {\n  &::-webkit-scrollbar {\n    width: $size;\n    height: $size;\n    background-color: $backgroundColor;\n  }\n\n  &::-webkit-scrollbar-thumb {\n    background-color: rgba($color, 0);\n    border-radius: 3px;\n  }\n\n  &:hover {\n    &::-webkit-scrollbar-thumb {\n      background-color: rgba($color, 1);\n    }\n  }\n\n  .dark-mode & {\n    &::-webkit-scrollbar-thumb {\n      background-color: rgba($dm-color-scrollbar, 0);\n      border-radius: 3px;\n    }\n\n    &:hover {\n      &::-webkit-scrollbar-thumb {\n        background-color: rgba($dm-color-scrollbar, 1);\n      }\n    }\n  }\n}\n\n// render 1px border in retina device\n// usage:\n//    in mobile page mobile: @include((#dbe2e9, 100px)\n//    in desktop page mobile: @include((#dbe2e9, 100px, 2px)\n@mixin border-1px($border-color, $border-radius, $border-width: 1px) {\n  position: relative;\n\n  &::before {\n    position: absolute;\n    top: 0;\n    left: 0;\n    z-index: 1;\n    box-sizing: border-box;\n    width: 200%;\n    height: 200%;\n    pointer-events: none;\n    content: '';\n    border: $border-width solid $border-color;\n    border-radius: $border-radius * 2;\n    transform: scale(.5, .5);\n    transform-origin: top left;\n  }\n}\n\n@mixin border-top-1px($border-color) {\n  position: relative;\n\n  &::before {\n    position: absolute;\n    top: 0;\n    left: 0;\n    width: 200%;\n    content: '';\n    border-top: 1px solid $border-color;\n    transform: scale(.5, .5);\n    transform-origin: top left;\n  }\n}\n\n@mixin border-bottom-1px($border-color) {\n  position: relative;\n\n  &::after {\n    position: absolute;\n    bottom: 0;\n    left: 0;\n    width: 200%;\n    content: '';\n    border-bottom: 1px solid $border-color;\n    transform: scale(.5, .5);\n    transform-origin: bottom left;\n  }\n}\n\n@mixin border-left-1px($border-color, $border-width: 1px) {\n  position: relative;\n\n  &::after {\n    position: absolute;\n    bottom: 0;\n    left: 0;\n    z-index: 1;\n    width: 200%;\n    height: 200%;\n    content: '';\n    border-left: $border-width solid $border-color;\n    border-radius: 0;\n    transform: scale(.5, .5);\n    transform-origin: bottom left;\n  }\n}\n\n@mixin border-right-1px($border-color, $border-width: 1px) {\n  position: relative;\n\n  &::after {\n    position: absolute;\n    bottom: 0;\n    left: 0;\n    z-index: 1;\n    width: 200%;\n    height: 200%;\n    content: '';\n    border-right: $border-width solid $border-color;\n    border-radius: 0;\n    transform: scale(.5, .5);\n    transform-origin: bottom left;\n  }\n}\n\n@mixin modal-dialog-footer {\n  padding: 0;\n  margin: 0;\n  margin-left: -1px;\n  border-top: 1px solid $color-border;\n\n  .components-button {\n    height: 52px;\n    margin-right: 0;\n    border-radius: 0;\n\n    &::before {\n      display: none;\n    }\n\n    &.components-button-type-orange {\n      color: $color-primary;\n      background: none;\n    }\n  }\n\n  .components-button + .components-button {\n    margin-left: 0; // fix the safari gap issue\n    border-left: 1px solid $color-border;\n  }\n\n  .dark-mode & {\n    border-top: 1px solid $dm-color-border;\n\n    .components-button {\n      color: $dm-color-text-secondary;\n      background: $dm-color-button-bg;\n\n      &.components-button-type-orange {\n        color: $color-primary;\n      }\n    }\n\n    .components-button + .components-button {\n      border-left: 1px solid $dm-color-border;\n    }\n  }\n}\n"]
