        sourcesContent: ["@import 'common/styles/variables.scss';\n@import 'common/styles/mixins.scss';\n\n.components-chatbox-user-menu {\n  display: inline-flex;\n  align-items: center;\n\n  .message-badge {\n    display: inline-flex;\n    flex: none;\n    align-content: center;\n    margin-right: 6px;\n    font-size: 16px;\n    vertical-align: middle;\n\n    .badge-icon {\n      width: auto;\n      height: 16px;\n      margin-right: 3px;\n\n      &:last-child {\n        margin-right: 0;\n      }\n    }\n  }\n\n  .message-avatar {\n    width: 24px;\n    height: 24px;\n    margin-right: 6px;\n    background-color: #eee;\n    border-radius: 24px;\n  }\n\n  .username {\n    color: #9e9e9e;\n    cursor: pointer;\n\n    &.badge-202 {\n      color: #0e6ce9;\n    }\n\n    &.badge-201 {\n      color: #ff8200;\n    }\n  }\n}\n\n.components-chatbox-user-menu-popover {\n  width: 200px;\n  background-color: #25252b;\n\n  .user-info {\n    display: flex;\n    align-items: flex-start;\n    padding: 6px 16px 16px;\n    font-size: 16px;\n    font-weight: 600;\n\n    &.no-link {\n      pointer-events: none;\n    }\n\n    .username {\n      @include ellipsis();\n\n      font-size: 14px;\n      color: $color-text;\n    }\n\n    .components-profile-card-center-bottom {\n      min-width: 120px;\n\n      .userid {\n        font-size: 12px;\n        font-weight: 400;\n        color: rgba(#757575, .8);\n      }\n    }\n\n    .badge {\n      display: flex;\n      align-items: center;\n      width: 16px;\n      height: 16px;\n      padding: 2px;\n      margin-left: 4px;\n      background-color: #f5f6fa;\n      border-radius: 2px;\n    }\n  }\n\n  .components-btns-follow {\n    padding: 12px 20px;\n\n    .components-button {\n      width: 100%;\n    }\n  }\n}\n\n.dark-mode {\n  .components-chatbox-user-menu-popover {\n    width: 200px;\n\n    .components-popover-menu-item {\n      background-color: #25252b;\n    }\n\n    .user-info {\n      .username {\n        color: $dm-color-text-secondary;\n      }\n\n      .userid {\n        font-size: 12px;\n        font-weight: 400;\n        color: $dm-color-text-secondary;\n      }\n\n      .badge {\n        background-color: transparent;\n      }\n    }\n  }\n}\n", "@import 'common/styles/variables.scss';\n\n@mixin limit-content-width {\n  box-sizing: border-box;\n  width: 100%;\n  max-width: $content-max-width + 40;\n  padding-right: 20px;\n  padding-left: 20px;\n  margin: 0 auto;\n}\n\n@mixin flex-center {\n  display: flex;\n  align-items: center;\n  justify-content: center;\n}\n\n@mixin ellipsis {\n  overflow: hidden;\n  text-overflow: ellipsis;\n  white-space: nowrap;\n}\n\n@mixin ellipsis-flex-container {\n  min-width: 0;\n}\n\n@mixin block-ellipsis($lines: 2) {\n  display: -webkit-box;\n  overflow: hidden;\n  text-overflow: ellipsis;\n  white-space: normal;\n  -webkit-line-clamp: $lines;\n  // prevent this rule removed by autoprefixer\n  // see: https://github.com/postcss/autoprefixer/issues/776\n\n  /*! autoprefixer: off */\n  -webkit-box-orient: vertical;\n}\n\n@mixin align-center {\n  position: absolute;\n  top: 50%;\n  left: 50%;\n  transform: translate(-50%, -50%);\n}\n\n@mixin absolute-cover {\n  position: absolute;\n  top: 0;\n  right: 0;\n  bottom: 0;\n  left: 0;\n}\n\n@mixin scrollbar($size: 6px, $color: #d8d8db, $backgroundColor: transparent) {\n  &::-webkit-scrollbar {\n    width: $size;\n    height: $size;\n    background-color: $backgroundColor;\n  }\n\n  &::-webkit-scrollbar-thumb {\n    background-color: rgba($color, 0);\n    border-radius: 3px;\n  }\n\n  &:hover {\n    &::-webkit-scrollbar-thumb {\n      background-color: rgba($color, 1);\n    }\n  }\n\n  .dark-mode & {\n    &::-webkit-scrollbar-thumb {\n      background-color: rgba($dm-color-scrollbar, 0);\n      border-radius: 3px;\n    }\n\n    &:hover {\n      &::-webkit-scrollbar-thumb {\n        background-color: rgba($dm-color-scrollbar, 1);\n      }\n    }\n  }\n}\n\n// render 1px border in retina device\n// usage:\n//    in mobile page mobile: @include((#dbe2e9, 100px)\n//    in desktop page mobile: @include((#dbe2e9, 100px, 2px)\n@mixin border-1px($border-color, $border-radius, $border-width: 1px) {\n  position: relative;\n\n  &::before {\n    position: absolute;\n    top: 0;\n    left: 0;\n    z-index: 1;\n    box-sizing: border-box;\n    width: 200%;\n    height: 200%;\n    pointer-events: none;\n    content: '';\n    border: $border-width solid $border-color;\n    border-radius: $border-radius * 2;\n    transform: scale(.5, .5);\n    transform-origin: top left;\n  }\n}\n\n@mixin border-top-1px($border-color) {\n  position: relative;\n\n  &::before {\n    position: absolute;\n    top: 0;\n    left: 0;\n    width: 200%;\n    content: '';\n    border-top: 1px solid $border-color;\n    transform: scale(.5, .5);\n    transform-origin: top left;\n  }\n}\n\n@mixin border-bottom-1px($border-color) {\n  position: relative;\n\n  &::after {\n    position: absolute;\n    bottom: 0;\n    left: 0;\n    width: 200%;\n    content: '';\n    border-bottom: 1px solid $border-color;\n    transform: scale(.5, .5);\n    transform-origin: bottom left;\n  }\n}\n\n@mixin border-left-1px($border-color, $border-width: 1px) {\n  position: relative;\n\n  &::after {\n    position: absolute;\n    bottom: 0;\n    left: 0;\n    z-index: 1;\n    width: 200%;\n    height: 200%;\n    content: '';\n    border-left: $border-width solid $border-color;\n    border-radius: 0;\n    transform: scale(.5, .5);\n    transform-origin: bottom left;\n  }\n}\n\n@mixin border-right-1px($border-color, $border-width: 1px) {\n  position: relative;\n\n  &::after {\n    position: absolute;\n    bottom: 0;\n    left: 0;\n    z-index: 1;\n    width: 200%;\n    height: 200%;\n    content: '';\n    border-right: $border-width solid $border-color;\n    border-radius: 0;\n    transform: scale(.5, .5);\n    transform-origin: bottom left;\n  }\n}\n\n@mixin modal-dialog-footer {\n  padding: 0;\n  margin: 0;\n  margin-left: -1px;\n  border-top: 1px solid $color-border;\n\n  .components-button {\n    height: 52px;\n    margin-right: 0;\n    border-radius: 0;\n\n    &::before {\n      display: none;\n    }\n\n    &.components-button-type-orange {\n      color: $color-primary;\n      background: none;\n    }\n  }\n\n  .components-button + .components-button {\n    margin-left: 0; // fix the safari gap issue\n    border-left: 1px solid $color-border;\n  }\n\n  .dark-mode & {\n    border-top: 1px solid $dm-color-border;\n\n    .components-button {\n      color: $dm-color-text-secondary;\n      background: $dm-color-button-bg;\n\n      &.components-button-type-orange {\n        color: $color-primary;\n      }\n    }\n\n    .components-button + .components-button {\n      border-left: 1px solid $dm-color-border;\n    }\n  }\n}\n", "// light mode\n// color\n$color-primary: #ffba00;\n$color-text: #16181a;\n$color-text-secondary: rgba($color-text, .45);\n$color-disable: #c6cbd8;\n$color-border: #edeff7;\n$color-red: #ef3d48;\n$color-success: #16bc8b;\n\n// gradient\n$gradient-yellow: linear-gradient(265deg, #ffa900 0%, #ffba00 100%);\n$gradient-red: linear-gradient(-180deg, #ff4d58 0%, #e5202c 100%);\n\n// font\n$font-amount: 'Agency FB', 'Open Sans';\n$font-agency-fb: 'Agency FB', 'Open Sans', amiri, arial, helvetica, 'Droid Sans', system-ui, -apple-system, blinkmacsystemfont, 'Helvetica Neue', sans-serif;\n\n// z-index\n$z-report-dialog: 3000;\n$z-staff-dialog: 3000;\n$z-playback-panel-more-popover: 1002;\n$z-xman-dialog: 2000;\n$z-toast: 1002;\n$z-dialog: 1001;\n$z-popover: 1000;\n$z-spinner: 999;\n$z-dropdown-popover: 998;\n$z-side-nav: 200;\n$z-video-poster-tag: 100;\n$z-header: 997;\n\n// width\n$mobile-modal-width: 310px; //iphone5 and motoG4 width is 320, 10px margin\n$content-max-width: 1200px;\n$content-min-width: 1024px;\n\n// dark mode\n// https://app.sympli.io/app#!/designs/6081507cf475fb47060cf69e/specs/assets\n// color\n$dm-color-text: #e8e8f0;\n$dm-color-text-secondary: #adadba;\n$dm-color-border: #242428;\n$dm-color-border-light: #47474a;\n$dm-color-icon: #5e5e68;\n$dm-color-popover-icon: #81818d;\n$dm-color-button-disabled: rgba(#fff, .25);\n$dm-color-scrollbar: #404046;\n\n// bg colors\n$dm-color-bg-1: #101012; // most dark\n$dm-color-bg-2: #19191d;\n$dm-color-modal-bg: #1e1e25;\n$dm-color-input-bg: #25252b;\n$dm-color-modal-input-bg: #292930;\n$dm-color-button-bg: #303034;\n$dm-color-button-hover-bg: #38383e; // least dark\n$dm-color-button-disabled-bg: #26262b;\n\n// box-shadow\n$dm-box-shadow-modal: 0 0 48px 0 rgba(#000, .11);\n"]
