        sourcesContent: ["@import 'common/styles/variables.scss';\n\n.components-chatbox-voting-popup {\n  position: absolute;\n  right: 12px;\n  bottom: 0;\n  left: 12px;\n  display: none;\n  background: #1e1e25;\n  border-radius: 6px;\n\n  &.show {\n    display: block;\n  }\n\n  .head {\n    display: flex;\n    flex-direction: column;\n    align-items: center;\n    justify-content: center;\n    height: 70px;\n    color: #531300;\n    background-color: $color-primary;\n    background-image: url('../../../assets/images/voting-channel-header-bg.png');\n    background-repeat: no-repeat;\n    background-size: auto 70px;\n    border-radius: 6px 6px 0 0;\n\n    .title {\n      font-size: 20px;\n      font-weight: 600;\n    }\n\n    .info {\n      display: flex;\n      align-items: center;\n      justify-content: center;\n      font-size: 14px;\n    }\n\n    .close-icon {\n      position: absolute;\n      top: 6px;\n      right: 6px;\n      font-size: 16px;\n      cursor: pointer;\n    }\n  }\n\n  .content {\n    padding: 17px 20px 20px;\n\n    .title {\n      font-size: 18px;\n      color: #fff;\n      word-break: break-all;\n    }\n\n    .options-horizontal {\n      display: flex;\n      align-items: center;\n      justify-content: space-between;\n      margin-top: 18px;\n      margin-bottom: 16px;\n\n      .option {\n        display: flex;\n        flex-flow: column;\n        align-items: center;\n        justify-content: center;\n        width: 145px;\n        min-height: 60px;\n        word-break: break-all;\n        cursor: pointer;\n        background-color: #2b2b31;\n        border: 1px solid #2b2b31;\n        border-radius: 6px;\n\n        .txt {\n          overflow-y: scroll;\n          font-size: 18px;\n          &::-webkit-scrollbar { width: 0; }\n          &::-webkit-scrollbar-thumb { width: 0; }\n        }\n\n        &.hover {\n          &:hover {\n            border: 1px solid $color-primary;\n\n            .txt {\n              color: $color-primary;\n            }\n          }\n        }\n\n        &.current {\n          background-image: url('../../../assets/images/voting-select-icon.png');\n          background-repeat: no-repeat;\n          background-position: -2px -2px;\n          background-size: 30px auto;\n          border: 1px solid $color-primary;\n\n          .txt {\n            color: $color-primary;\n          }\n        }\n      }\n    }\n\n    .options-portrait {\n      max-height: 186px;\n      overflow-y: scroll;\n      &::-webkit-scrollbar { width: 0; }\n      &::-webkit-scrollbar-thumb { width: 0; }\n\n      .option {\n        display: flex;\n        align-items: center;\n        height: 50px;\n        padding: 10px 14px;\n        margin-top: 10px;\n        word-break: break-all;\n        cursor: pointer;\n        background-color: #2b2b31;\n        border: 1px solid #2b2b31;\n        border-radius: 6px;\n\n        .txt {\n          font-size: 20px;\n        }\n\n        &.hover {\n          &:hover {\n            border: 1px solid $color-primary;\n\n            .txt {\n              color: $color-primary;\n            }\n          }\n        }\n\n        &.current {\n          background-image: url('../../../assets/images/voting-select-icon.png');\n          background-repeat: no-repeat;\n          background-position: -2px -2px;\n          background-size: 26px auto;\n          border: 1px solid $color-primary;\n\n          .txt {\n            color: $color-primary;\n          }\n        }\n\n      }\n    }\n\n    .submit-btn {\n      margin-top: 20px;\n    }\n  }\n}\n", "// light mode\n// color\n$color-primary: #ffba00;\n$color-text: #16181a;\n$color-text-secondary: rgba($color-text, .45);\n$color-disable: #c6cbd8;\n$color-border: #edeff7;\n$color-red: #ef3d48;\n$color-success: #16bc8b;\n\n// gradient\n$gradient-yellow: linear-gradient(265deg, #ffa900 0%, #ffba00 100%);\n$gradient-red: linear-gradient(-180deg, #ff4d58 0%, #e5202c 100%);\n\n// font\n$font-amount: 'Agency FB', 'Open Sans';\n$font-agency-fb: 'Agency FB', 'Open Sans', amiri, arial, helvetica, 'Droid Sans', system-ui, -apple-system, blinkmacsystemfont, 'Helvetica Neue', sans-serif;\n\n// z-index\n$z-report-dialog: 3000;\n$z-staff-dialog: 3000;\n$z-playback-panel-more-popover: 1002;\n$z-xman-dialog: 2000;\n$z-toast: 1002;\n$z-dialog: 1001;\n$z-popover: 1000;\n$z-spinner: 999;\n$z-dropdown-popover: 998;\n$z-side-nav: 200;\n$z-video-poster-tag: 100;\n$z-header: 997;\n\n// width\n$mobile-modal-width: 310px; //iphone5 and motoG4 width is 320, 10px margin\n$content-max-width: 1200px;\n$content-min-width: 1024px;\n\n// dark mode\n// https://app.sympli.io/app#!/designs/6081507cf475fb47060cf69e/specs/assets\n// color\n$dm-color-text: #e8e8f0;\n$dm-color-text-secondary: #adadba;\n$dm-color-border: #242428;\n$dm-color-border-light: #47474a;\n$dm-color-icon: #5e5e68;\n$dm-color-popover-icon: #81818d;\n$dm-color-button-disabled: rgba(#fff, .25);\n$dm-color-scrollbar: #404046;\n\n// bg colors\n$dm-color-bg-1: #101012; // most dark\n$dm-color-bg-2: #19191d;\n$dm-color-modal-bg: #1e1e25;\n$dm-color-input-bg: #25252b;\n$dm-color-modal-input-bg: #292930;\n$dm-color-button-bg: #303034;\n$dm-color-button-hover-bg: #38383e; // least dark\n$dm-color-button-disabled-bg: #26262b;\n\n// box-shadow\n$dm-box-shadow-modal: 0 0 48px 0 rgba(#000, .11);\n"]
