        sourcesContent: ["@import 'common/styles/variables.scss';\n\n.components-desktop-editor {\n  position: relative;\n  flex: none;\n\n  .prompt-follower-only,\n  .prompt-gifter-only,\n  .prompt-slow-mode {\n    overflow: hidden;\n    background-color: #fbfbfd;\n\n    .box {\n      padding: 14px 20px;\n      margin: 0 16px 16px;\n      overflow: hidden;\n      background: #fff;\n      border-radius: 6px;\n      box-shadow: 0 2px 17px 0 rgba(124, 124, 124, .07);\n\n      .title {\n        display: flex;\n        align-items: center;\n        margin-bottom: 4px;\n\n        .components-icon {\n          .highlight-bg {\n            opacity: 1;\n          }\n        }\n\n        & > span {\n          flex: auto;\n          margin-left: 8px;\n          font-size: 16px;\n        }\n\n        .countdown-number {\n          flex: none;\n          opacity: .8;\n\n          & > span {\n            font-size: 18px;\n            line-height: 22px;\n            color: #e08400;\n          }\n        }\n      }\n\n      .desc {\n        color: $color-text-secondary;\n      }\n    }\n  }\n\n  .btns-bar-container {\n    height: 50px;\n  }\n\n  .btns-bar {\n    position: absolute;\n    left: 0;\n    z-index: 2;\n    display: flex;\n    width: calc(100% - 32px);\n    height: 26px;\n    padding: 16px 16px 8px;\n    transform: scale3d(1, 1, 1);\n\n    > div[class^='components-chat-menu'] {\n      display: flex;\n      margin: 2px 20px 2px 0;\n\n      &:last-child {\n        margin-right: 0;\n      }\n\n      .toggle-btn {\n        display: inline-flex;\n        cursor: pointer;\n\n        .components-icon {\n          font-size: 22px;\n        }\n\n        &:hover,\n        &.active {\n          opacity: 1;\n\n          .components-icon {\n            .highlight-bg {\n              opacity: 1;\n            }\n          }\n        }\n      }\n    }\n  }\n\n  .editor-container {\n    position: relative;\n\n    .components-chat-menu-emoji {\n      position: absolute;\n      right: 24px;\n      bottom: 75px;\n      display: flex;\n      align-items: center;\n      padding-left: 16px;\n      cursor: pointer;\n\n      .toggle-btn {\n        z-index: 1;\n        display: inline-flex;\n\n        .components-icon {\n          font-size: 22px;\n        }\n\n        &:hover,\n        &.active {\n          .components-icon {\n            .highlight-bg {\n              opacity: 1;\n            }\n          }\n        }\n      }\n\n      .components-chat-menu-emoji-popover {\n        width: 380px;\n      }\n    }\n  }\n\n  .input-box {\n    position: relative;\n    flex: auto;\n    min-height: 90px;\n    padding: 10px 0 16px;\n\n    .components-input.components-input-textarea.components-input-size-normal {\n      padding: 0 16px;\n    }\n\n    &.input-box-limit {\n      .components-input.components-input-size-normal .components-input-element {\n        border: 1px solid $color-primary;\n      }\n    }\n\n    .letter-count-limit {\n      display: flex;\n      align-items: center;\n      padding: 0 16px;\n      margin-bottom: 6px;\n      color: $color-primary;\n\n      .components-icon {\n        margin-right: 4px;\n        font-size: 18px;\n      }\n    }\n\n    &:first-child {\n      padding-top: 16px;\n      border-top: 1px solid $color-border;\n    }\n\n    .components-input.components-input-size-normal .components-input-element {\n      padding: 10px 35px 10px 12px;\n      font-size: 14px;\n      background-color: #f5f5f8;\n      border: none;\n    }\n\n    .row {\n      position: absolute;\n      right: 12px;\n      bottom: 20px;\n      display: flex;\n      align-items: center;\n      justify-content: space-between;\n      margin-top: 12px;\n\n      .letter-count {\n        color: rgba($color: #757575, $alpha: .8);\n      }\n\n      .slow-mode-on {\n        z-index: 1;\n        width: 125px;\n        margin-right: 10px;\n        font-size: 12px;\n        color: rgba($color: #757575, $alpha: .8);\n        text-align: right;\n      }\n\n      .follower-only-chat {\n        z-index: 1;\n        width: 125px;\n        margin-right: 10px;\n        font-size: 12px;\n        color: rgba($color: #757575, $alpha: .8);\n        text-align: right;\n        animation-name: appear;\n        animation-duration: 10000ms;\n\n        @keyframes appear {\n          0% {\n            opacity: 0;\n          }\n\n          99% {\n            opacity: 0;\n          }\n\n          100% {\n            opacity: 1;\n          }\n        }\n      }\n\n      .send-btn {\n        z-index: 3;\n\n        &.disabled {\n          color: rgba($color: $color-text, $alpha: .3);\n          cursor: not-allowed;\n          background: #f5f5f8;\n        }\n\n        .slow-mode-number {\n          margin-right: 4px;\n          color: #fb0;\n        }\n      }\n    }\n  }\n\n  &.theme-dark {\n    .prompt-follower-only,\n    .prompt-gifter-only,\n    .prompt-slow-mode {\n      color: $dm-color-text;\n      background-color: $dm-color-modal-bg;\n\n      .box {\n        padding: 12px;\n        margin: 0;\n        background-color: $dm-color-modal-bg;\n        box-shadow: 0 0 0 0;\n\n        .title {\n          color: $dm-color-text;\n\n          .components-icon {\n            color: $dm-color-icon;\n\n            .highlight-bg {\n              opacity: 0;\n            }\n          }\n\n          .countdown-number {\n            & > span {\n              color: #e08400;\n            }\n          }\n        }\n\n        .desc {\n          color: $dm-color-text-secondary;\n        }\n      }\n    }\n\n    .btns-bar {\n      color: $dm-color-text;\n\n      > div[class^='components-chat-menu'] {\n        .toggle-btn {\n          opacity: .8;\n\n          &:hover,\n          &.active {\n            opacity: 1;\n\n            .components-icon {\n              color: $color-primary;\n              opacity: 1;\n\n              .highlight-bg {\n                opacity: 0;\n              }\n            }\n          }\n        }\n      }\n    }\n\n    .editor-container {\n      .components-chat-menu-emoji {\n        .toggle-btn {\n          &:hover,\n          &.active {\n            .components-icon {\n              color: $color-primary;\n              opacity: 1;\n\n              .highlight-bg {\n                opacity: 0;\n              }\n            }\n          }\n        }\n      }\n    }\n\n    .input-box {\n      .components-input.components-input-size-normal .components-input-element {\n        color: $dm-color-text;\n        background-color: $dm-color-input-bg;\n      }\n\n      &:first-child {\n        border-top-color: $dm-color-border;\n      }\n\n      .row {\n        .letter-count {\n          color: $dm-color-text-secondary;\n        }\n\n        .slow-mode-on,\n        .follower-only-chat {\n          color: $dm-color-text-secondary;\n        }\n\n        .send-btn {\n          &.disabled {\n            color: $dm-color-button-disabled;\n            background: $dm-color-button-disabled-bg;\n          }\n        }\n      }\n    }\n  }\n}\n\n.components-desktop-chatroom {\n  .components-chatbox-editor.spinner {\n    display: flex;\n    align-items: center;\n    justify-content: center;\n    min-height: 165px;\n  }\n}\n", "// light mode\n// color\n$color-primary: #ffba00;\n$color-text: #16181a;\n$color-text-secondary: rgba($color-text, .45);\n$color-disable: #c6cbd8;\n$color-border: #edeff7;\n$color-red: #ef3d48;\n$color-success: #16bc8b;\n\n// gradient\n$gradient-yellow: linear-gradient(265deg, #ffa900 0%, #ffba00 100%);\n$gradient-red: linear-gradient(-180deg, #ff4d58 0%, #e5202c 100%);\n\n// font\n$font-amount: 'Agency FB', 'Open Sans';\n$font-agency-fb: 'Agency FB', 'Open Sans', amiri, arial, helvetica, 'Droid Sans', system-ui, -apple-system, blinkmacsystemfont, 'Helvetica Neue', sans-serif;\n\n// z-index\n$z-report-dialog: 3000;\n$z-staff-dialog: 3000;\n$z-playback-panel-more-popover: 1002;\n$z-xman-dialog: 2000;\n$z-toast: 1002;\n$z-dialog: 1001;\n$z-popover: 1000;\n$z-spinner: 999;\n$z-dropdown-popover: 998;\n$z-side-nav: 200;\n$z-video-poster-tag: 100;\n$z-header: 997;\n\n// width\n$mobile-modal-width: 310px; //iphone5 and motoG4 width is 320, 10px margin\n$content-max-width: 1200px;\n$content-min-width: 1024px;\n\n// dark mode\n// https://app.sympli.io/app#!/designs/6081507cf475fb47060cf69e/specs/assets\n// color\n$dm-color-text: #e8e8f0;\n$dm-color-text-secondary: #adadba;\n$dm-color-border: #242428;\n$dm-color-border-light: #47474a;\n$dm-color-icon: #5e5e68;\n$dm-color-popover-icon: #81818d;\n$dm-color-button-disabled: rgba(#fff, .25);\n$dm-color-scrollbar: #404046;\n\n// bg colors\n$dm-color-bg-1: #101012; // most dark\n$dm-color-bg-2: #19191d;\n$dm-color-modal-bg: #1e1e25;\n$dm-color-input-bg: #25252b;\n$dm-color-modal-input-bg: #292930;\n$dm-color-button-bg: #303034;\n$dm-color-button-hover-bg: #38383e; // least dark\n$dm-color-button-disabled-bg: #26262b;\n\n// box-shadow\n$dm-box-shadow-modal: 0 0 48px 0 rgba(#000, .11);\n"]
