        sourcesContent: ["@import 'common/styles/functions.scss';\n@import 'common/styles/mixins.scss';\n\n.components-controller-mobile-live {\n  position: absolute;\n  top: 0;\n  right: 0;\n  bottom: 0;\n  left: 0;\n  width: 100%;\n  height: 100%;\n  transform: scale3d(1, 1, 1);\n\n  &.mini .full-controller {\n    opacity: 0;\n  }\n\n  &.mini .mini-bar {\n    visibility: visible;\n    opacity: 1;\n  }\n\n  .full-controller {\n    display: flex;\n    flex-direction: column;\n    width: 100%;\n    height: 100%;\n    visibility: visible;\n    background: linear-gradient(0deg, rgba(0, 0, 0, .5), rgba(0, 0, 0, 0) 50%, rgba(0, 0, 0, .5));\n    opacity: 1;\n    transition: opacity .5s;\n\n    .video-header {\n      box-sizing: border-box;\n      flex: none;\n      padding: 12px 15px 0;\n      font-weight: 500;\n      color: #fff;\n\n      .video-title {\n        @include ellipsis();\n\n        margin-bottom: 3px;\n        font-size: 18px;\n      }\n    }\n\n    .playback-btn {\n      position: absolute;\n      top: 50%;\n      left: 50%;\n      display: flex;\n      align-items: center;\n      justify-content: center;\n      width: 50px;\n      height: 50px;\n      padding: 20px;\n      font-size: 26px;\n      color: #fff;\n      transform: translate(-50%, -50%);\n\n      span {\n        display: flex;\n        padding: 15px;\n        background: #000;\n        border-radius: 50px;\n        opacity: .6;\n      }\n    }\n\n    .controller-bar {\n      box-sizing: border-box;\n      display: flex;\n      flex: auto;\n      align-items: flex-end;\n      padding: 0 15px 16px;\n      font-weight: 500;\n      color: #fff;\n\n      .views-count {\n        display: flex;\n        flex: auto;\n        align-items: center;\n        font-size: 14px;\n        opacity: .75;\n\n        span {\n          margin-left: 5px;\n        }\n      }\n\n      .controller-btn-logo {\n        display: flex;\n        padding-left: 15px;\n        font-size: 60px;\n        color: #fff;\n        opacity: .8;\n        transform: translateY(20px);\n      }\n\n      .fullscreen-btn {\n        flex: none;\n        width: 20px;\n        height: 20px;\n        padding-left: 15px;\n\n        .icon {\n          display: flex;\n          align-items: center;\n          font-size: 20px;\n          cursor: pointer;\n        }\n      }\n    }\n  }\n\n  .mini-bar {\n    position: absolute;\n    top: 0;\n    bottom: 0;\n    width: 100%;\n    visibility: hidden;\n    opacity: 0;\n    transition: opacity .5s, visibility .5s;\n  }\n}\n", "@import 'common/styles/variables.scss';\n\n@mixin limit-content-width {\n  box-sizing: border-box;\n  width: 100%;\n  max-width: $content-max-width + 40;\n  padding-right: 20px;\n  padding-left: 20px;\n  margin: 0 auto;\n}\n\n@mixin flex-center {\n  display: flex;\n  align-items: center;\n  justify-content: center;\n}\n\n@mixin ellipsis {\n  overflow: hidden;\n  text-overflow: ellipsis;\n  white-space: nowrap;\n}\n\n@mixin ellipsis-flex-container {\n  min-width: 0;\n}\n\n@mixin block-ellipsis($lines: 2) {\n  display: -webkit-box;\n  overflow: hidden;\n  text-overflow: ellipsis;\n  white-space: normal;\n  -webkit-line-clamp: $lines;\n  // prevent this rule removed by autoprefixer\n  // see: https://github.com/postcss/autoprefixer/issues/776\n\n  /*! autoprefixer: off */\n  -webkit-box-orient: vertical;\n}\n\n@mixin align-center {\n  position: absolute;\n  top: 50%;\n  left: 50%;\n  transform: translate(-50%, -50%);\n}\n\n@mixin absolute-cover {\n  position: absolute;\n  top: 0;\n  right: 0;\n  bottom: 0;\n  left: 0;\n}\n\n@mixin scrollbar($size: 6px, $color: #d8d8db, $backgroundColor: transparent) {\n  &::-webkit-scrollbar {\n    width: $size;\n    height: $size;\n    background-color: $backgroundColor;\n  }\n\n  &::-webkit-scrollbar-thumb {\n    background-color: rgba($color, 0);\n    border-radius: 3px;\n  }\n\n  &:hover {\n    &::-webkit-scrollbar-thumb {\n      background-color: rgba($color, 1);\n    }\n  }\n\n  .dark-mode & {\n    &::-webkit-scrollbar-thumb {\n      background-color: rgba($dm-color-scrollbar, 0);\n      border-radius: 3px;\n    }\n\n    &:hover {\n      &::-webkit-scrollbar-thumb {\n        background-color: rgba($dm-color-scrollbar, 1);\n      }\n    }\n  }\n}\n\n// render 1px border in retina device\n// usage:\n//    in mobile page mobile: @include((#dbe2e9, 100px)\n//    in desktop page mobile: @include((#dbe2e9, 100px, 2px)\n@mixin border-1px($border-color, $border-radius, $border-width: 1px) {\n  position: relative;\n\n  &::before {\n    position: absolute;\n    top: 0;\n    left: 0;\n    z-index: 1;\n    box-sizing: border-box;\n    width: 200%;\n    height: 200%;\n    pointer-events: none;\n    content: '';\n    border: $border-width solid $border-color;\n    border-radius: $border-radius * 2;\n    transform: scale(.5, .5);\n    transform-origin: top left;\n  }\n}\n\n@mixin border-top-1px($border-color) {\n  position: relative;\n\n  &::before {\n    position: absolute;\n    top: 0;\n    left: 0;\n    width: 200%;\n    content: '';\n    border-top: 1px solid $border-color;\n    transform: scale(.5, .5);\n    transform-origin: top left;\n  }\n}\n\n@mixin border-bottom-1px($border-color) {\n  position: relative;\n\n  &::after {\n    position: absolute;\n    bottom: 0;\n    left: 0;\n    width: 200%;\n    content: '';\n    border-bottom: 1px solid $border-color;\n    transform: scale(.5, .5);\n    transform-origin: bottom left;\n  }\n}\n\n@mixin border-left-1px($border-color, $border-width: 1px) {\n  position: relative;\n\n  &::after {\n    position: absolute;\n    bottom: 0;\n    left: 0;\n    z-index: 1;\n    width: 200%;\n    height: 200%;\n    content: '';\n    border-left: $border-width solid $border-color;\n    border-radius: 0;\n    transform: scale(.5, .5);\n    transform-origin: bottom left;\n  }\n}\n\n@mixin border-right-1px($border-color, $border-width: 1px) {\n  position: relative;\n\n  &::after {\n    position: absolute;\n    bottom: 0;\n    left: 0;\n    z-index: 1;\n    width: 200%;\n    height: 200%;\n    content: '';\n    border-right: $border-width solid $border-color;\n    border-radius: 0;\n    transform: scale(.5, .5);\n    transform-origin: bottom left;\n  }\n}\n\n@mixin modal-dialog-footer {\n  padding: 0;\n  margin: 0;\n  margin-left: -1px;\n  border-top: 1px solid $color-border;\n\n  .components-button {\n    height: 52px;\n    margin-right: 0;\n    border-radius: 0;\n\n    &::before {\n      display: none;\n    }\n\n    &.components-button-type-orange {\n      color: $color-primary;\n      background: none;\n    }\n  }\n\n  .components-button + .components-button {\n    margin-left: 0; // fix the safari gap issue\n    border-left: 1px solid $color-border;\n  }\n\n  .dark-mode & {\n    border-top: 1px solid $dm-color-border;\n\n    .components-button {\n      color: $dm-color-text-secondary;\n      background: $dm-color-button-bg;\n\n      &.components-button-type-orange {\n        color: $color-primary;\n      }\n    }\n\n    .components-button + .components-button {\n      border-left: 1px solid $dm-color-border;\n    }\n  }\n}\n"]
