        sourcesContent: ["@import 'common/styles/variables.scss';\n\n.components-controller-desktop {\n  position: absolute;\n  top: 0;\n  right: 0;\n  bottom: 0;\n  left: 0;\n  width: 100%;\n  height: 100%;\n\n  &.mini .full-controller {\n    opacity: 0;\n  }\n\n  &.mini .mini-bar {\n    visibility: visible;\n    opacity: 1;\n  }\n\n  .full-controller {\n    position: absolute;\n    top: 0;\n    bottom: 0;\n    display: flex;\n    flex-direction: column;\n    width: 100%;\n    opacity: 1;\n    transition: opacity .5s;\n\n    .top-bar {\n      flex: auto;\n\n      .playback-btn {\n        position: absolute;\n        top: 50%;\n        left: 50%;\n        display: flex;\n        align-items: center;\n        justify-content: center;\n        width: 60px;\n        height: 60px;\n        font-size: 26px;\n        color: #fff;\n        text-align: center;\n        cursor: pointer;\n        background-color: rgba(0, 0, 0, .6);\n        border-radius: 50px;\n        transform: translate(-50%, -50%);\n      }\n    }\n\n    .progress-bar {\n      z-index: 2;\n      flex: none;\n      height: 14px;\n      cursor: pointer;\n      transform: translateY(55px);\n\n      .rc-slider-track {\n        height: 2px;\n        background-color: $color-primary;\n        border-radius: 0;\n        transition: transform .1s;\n      }\n\n      .rc-slider-rail {\n        height: 2px;\n        background-color: rgba(255, 255, 255, .15);\n        border-radius: 0;\n        transition: transform .1s;\n      }\n\n      .rc-slider-handle {\n        margin-top: -5px;\n        background-color: #fff;\n        border-width: 0;\n        opacity: 0;\n        transition: opacity .1s, transform .1s;\n        transform: scale(0);\n      }\n\n      &:hover,\n      &.dragging {\n        .rc-slider-track,\n        .rc-slider-rail {\n          transform: scale(1, 3);\n        }\n\n        .rc-slider-handle {\n          opacity: 1;\n          transform: scale(1);\n        }\n      }\n    }\n\n    .controller-bar {\n      box-sizing: border-box;\n      display: flex;\n      flex: none;\n      align-items: flex-end;\n      height: 90px;\n      padding: 10px;\n      font-size: 20px;\n      font-weight: 500;\n      color: #fff;\n      background-image: linear-gradient(0deg, rgba(0, 0, 0, .5) 0%, rgba(0, 0, 0, 0) 100%);\n\n      .time {\n        display: flex;\n        flex: auto;\n        align-items: center;\n        height: 20px;\n\n        .current-time,\n        .duration {\n          font-size: 12px;\n          color: #fff;\n        }\n\n        .duration {\n          opacity: .45;\n        }\n\n        .divider {\n          height: 10px;\n          margin: 0 5px;\n          border-left: 1px solid #fff;\n          opacity: .45;\n        }\n      }\n\n      .controller-btn {\n        height: 20px;\n        margin-right: 22px;\n        cursor: pointer;\n        transition: color .3s;\n\n        &:hover {\n          color: $color-primary;\n        }\n\n        &:last-child {\n          margin-right: 0;\n        }\n\n        &.controller-btn-play,\n        &.controller-btn-pause,\n        &.controller-btn-fullscreen {\n          display: flex;\n        }\n      }\n    }\n\n    .bg-mask {\n      position: absolute;\n      top: 0;\n      right: 0;\n      bottom: 0;\n      left: 0;\n      background: linear-gradient(0deg, #000, rgba(0, 0, 0, 0%) 50%, #000);\n    }\n  }\n\n  .mini-bar {\n    position: absolute;\n    top: 0;\n    bottom: 0;\n    width: 100%;\n    visibility: hidden;\n    opacity: 0;\n    transition: opacity .5s, visibility .5s;\n\n    .progress-bar {\n      position: absolute;\n      bottom: 0;\n      width: 100%;\n      height: 2px;\n      background-color: rgba(255, 255, 255, .36);\n\n      .progress-played {\n        height: 100%;\n        background-color: $color-primary;\n      }\n    }\n  }\n}\n", "// light mode\n// color\n$color-primary: #ffba00;\n$color-text: #16181a;\n$color-text-secondary: rgba($color-text, .45);\n$color-disable: #c6cbd8;\n$color-border: #edeff7;\n$color-red: #ef3d48;\n$color-success: #16bc8b;\n\n// gradient\n$gradient-yellow: linear-gradient(265deg, #ffa900 0%, #ffba00 100%);\n$gradient-red: linear-gradient(-180deg, #ff4d58 0%, #e5202c 100%);\n\n// font\n$font-amount: 'Agency FB', 'Open Sans';\n$font-agency-fb: 'Agency FB', 'Open Sans', amiri, arial, helvetica, 'Droid Sans', system-ui, -apple-system, blinkmacsystemfont, 'Helvetica Neue', sans-serif;\n\n// z-index\n$z-report-dialog: 3000;\n$z-staff-dialog: 3000;\n$z-playback-panel-more-popover: 1002;\n$z-xman-dialog: 2000;\n$z-toast: 1002;\n$z-dialog: 1001;\n$z-popover: 1000;\n$z-spinner: 999;\n$z-dropdown-popover: 998;\n$z-side-nav: 200;\n$z-video-poster-tag: 100;\n$z-header: 997;\n\n// width\n$mobile-modal-width: 310px; //iphone5 and motoG4 width is 320, 10px margin\n$content-max-width: 1200px;\n$content-min-width: 1024px;\n\n// dark mode\n// https://app.sympli.io/app#!/designs/6081507cf475fb47060cf69e/specs/assets\n// color\n$dm-color-text: #e8e8f0;\n$dm-color-text-secondary: #adadba;\n$dm-color-border: #242428;\n$dm-color-border-light: #47474a;\n$dm-color-icon: #5e5e68;\n$dm-color-popover-icon: #81818d;\n$dm-color-button-disabled: rgba(#fff, .25);\n$dm-color-scrollbar: #404046;\n\n// bg colors\n$dm-color-bg-1: #101012; // most dark\n$dm-color-bg-2: #19191d;\n$dm-color-modal-bg: #1e1e25;\n$dm-color-input-bg: #25252b;\n$dm-color-modal-input-bg: #292930;\n$dm-color-button-bg: #303034;\n$dm-color-button-hover-bg: #38383e; // least dark\n$dm-color-button-disabled-bg: #26262b;\n\n// box-shadow\n$dm-box-shadow-modal: 0 0 48px 0 rgba(#000, .11);\n"]
