        sourcesContent: ["@import 'common/styles/variables.scss';\n\n.components-video-poster {\n  position: relative;\n  box-sizing: border-box;\n  width: 100%;\n  padding-top: 56.25%; // keep in 16:9 ratio\n  overflow: hidden;\n\n  .poster-image {\n    position: absolute;\n    top: 0;\n    right: 0;\n    bottom: 0;\n    left: 0;\n    background-color: #333;\n\n    img {\n      height: 100%;\n      object-fit: cover;\n    }\n  }\n\n  .tag {\n    $space: 12px;\n\n    position: absolute;\n    right: $space;\n    left: $space;\n    z-index: $z-video-poster-tag;\n    display: flex;\n    font-size: 12px;\n    color: #fff;\n\n    .gray-out-text {\n      color: rgba(#fff, .8);\n    }\n\n    &.left {\n      justify-content: flex-start;\n    }\n\n    &.right {\n      justify-content: flex-end;\n    }\n\n    &.top {\n      top: $space - 2px;\n    }\n\n    &.bottom {\n      bottom: $space - 2px;\n    }\n\n    .mask {\n      display: flex;\n      align-items: stretch;\n      padding: 3px 9px;\n      background: rgba(#000, .6);\n      border-radius: 12px;\n    }\n\n    .components-streamer-label {\n      position: relative;\n      top: -4px;\n      left: -6px;\n      max-width: 50%;\n    }\n\n    .lootdrop-flag {\n      position: relative;\n      top: -7px;\n      right: -13px;\n      max-width: 50%;\n    }\n  }\n\n  .overlay {\n    position: absolute;\n    top: 0;\n    right: 0;\n    bottom: 0;\n    left: 0;\n    z-index: 1;\n    display: flex;\n    align-items: center;\n    justify-content: center;\n\n    .overlay-mask {\n      position: absolute;\n      right: 0;\n      bottom: 0;\n      left: 0;\n      height: 60px;\n      background-image: linear-gradient(-180deg, transparent 12%, #000 99%);\n      opacity: .45;\n    }\n\n    .play-container {\n      display: flex;\n      align-items: center;\n      justify-content: center;\n      width: 50px;\n      height: 50px;\n      font-size: 20px;\n      color: #fff;\n      background-color: rgba(#000, .6);\n      border-radius: 50%;\n      opacity: 0;\n      transition: opacity .1s;\n    }\n  }\n\n  @media (hover: hover) {\n    &:hover .overlay {\n      .play-container {\n        will-change: opacity;\n        opacity: 1;\n      }\n    }\n  }\n}\n\n.mobile {\n  .components-video-poster {\n    .tag {\n      $space: 8px;\n\n      right: $space;\n      left: $space;\n      font-size: 10px;\n\n      &.top {\n        top: $space - 2px;\n      }\n\n      &.bottom {\n        bottom: $space - 2px;\n      }\n\n      .components-streamer-label {\n        top: -2px;\n        left: -4px;\n      }\n\n      .lootdrop-flag {\n        top: -8px;\n        right: -8px;\n      }\n    }\n  }\n}\n\n.dark-mode {\n  .components-video-poster {\n    .tag {\n      color: $dm-color-text;\n\n      .gray-out-text {\n        color: $dm-color-text;\n      }\n    }\n\n    .overlay {\n      .play-container {\n        color: $dm-color-text;\n      }\n    }\n  }\n}\n", "// light mode\n// color\n$color-primary: #ffba00;\n$color-text: #16181a;\n$color-text-secondary: rgba($color-text, .45);\n$color-disable: #c6cbd8;\n$color-border: #edeff7;\n$color-red: #ef3d48;\n$color-success: #16bc8b;\n\n// gradient\n$gradient-yellow: linear-gradient(265deg, #ffa900 0%, #ffba00 100%);\n$gradient-red: linear-gradient(-180deg, #ff4d58 0%, #e5202c 100%);\n\n// font\n$font-amount: 'Agency FB', 'Open Sans';\n$font-agency-fb: 'Agency FB', 'Open Sans', amiri, arial, helvetica, 'Droid Sans', system-ui, -apple-system, blinkmacsystemfont, 'Helvetica Neue', sans-serif;\n\n// z-index\n$z-report-dialog: 3000;\n$z-staff-dialog: 3000;\n$z-playback-panel-more-popover: 1002;\n$z-xman-dialog: 2000;\n$z-toast: 1002;\n$z-dialog: 1001;\n$z-popover: 1000;\n$z-spinner: 999;\n$z-dropdown-popover: 998;\n$z-side-nav: 200;\n$z-video-poster-tag: 100;\n$z-header: 997;\n\n// width\n$mobile-modal-width: 310px; //iphone5 and motoG4 width is 320, 10px margin\n$content-max-width: 1200px;\n$content-min-width: 1024px;\n\n// dark mode\n// https://app.sympli.io/app#!/designs/6081507cf475fb47060cf69e/specs/assets\n// color\n$dm-color-text: #e8e8f0;\n$dm-color-text-secondary: #adadba;\n$dm-color-border: #242428;\n$dm-color-border-light: #47474a;\n$dm-color-icon: #5e5e68;\n$dm-color-popover-icon: #81818d;\n$dm-color-button-disabled: rgba(#fff, .25);\n$dm-color-scrollbar: #404046;\n\n// bg colors\n$dm-color-bg-1: #101012; // most dark\n$dm-color-bg-2: #19191d;\n$dm-color-modal-bg: #1e1e25;\n$dm-color-input-bg: #25252b;\n$dm-color-modal-input-bg: #292930;\n$dm-color-button-bg: #303034;\n$dm-color-button-hover-bg: #38383e; // least dark\n$dm-color-button-disabled-bg: #26262b;\n\n// box-shadow\n$dm-box-shadow-modal: 0 0 48px 0 rgba(#000, .11);\n"]
