        sourcesContent: ["@import 'common/styles/variables.scss';\n\n.views-channel-free-tickets-icon {\n  position: relative;\n  width: 40px;\n  height: 40px;\n  cursor: pointer;\n\n  .hidden {\n    display: none;\n  }\n\n  .countdown-container {\n    position: absolute;\n    right: 0;\n    bottom: 5px;\n    left: 1px;\n    font-size: 9px;\n    font-weight: 700;\n    color: #ffda6b;\n    text-align: center;\n  }\n\n  .claimable-count {\n    position: absolute;\n    top: -2px;\n    right: -3px;\n    display: flex;\n    align-items: center;\n    justify-content: center;\n    width: 16px;\n    height: 16px;\n    font-size: 10px;\n    color: #fff;\n    background-color: #ef3d48;\n    border: 1px solid #fff;\n    border-radius: 50%;\n  }\n\n  .login-claim-tip {\n    padding: 8px;\n  }\n}\n\n.views-channel-free-tickets-popover-wrapper {\n  padding: 12px 22px;\n  padding-bottom: 24px;\n\n  .header-container {\n    display: flex;\n    align-items: center;\n    padding-bottom: 12px;\n    border-bottom: 1px solid #edeff7;\n\n    .title {\n      flex: 1;\n      font-size: 14px;\n      font-weight: 600;\n      line-height: 20px;\n      color: $color-text;\n    }\n\n    .components-icon {\n      position: relative;\n      top: 2px;\n      left: 2px;\n      font-size: 20px;\n      cursor: pointer;\n    }\n  }\n\n  .boxes-container {\n    display: flex;\n    align-items: center;\n    margin-top: 14px;\n    text-align: center;\n  }\n\n  .box-wrapper {\n    width: 64px;\n    margin-right: 34px;\n\n    .image-container {\n      display: flex;\n      align-items: center;\n      justify-content: center;\n      margin-bottom: 7px;\n\n      img {\n        width: auto;\n        height: 40px;\n      }\n    }\n\n    &:last-child {\n      margin-right: 0;\n    }\n\n    .label-tickets {\n      margin-bottom: 14px;\n      font-size: 12px;\n      line-height: 16px;\n      color: $color-text-secondary;\n    }\n\n    .box-button-disabled {\n      padding: 8px 0;\n      font-size: 12px;\n      line-height: 14px;\n      text-align: center;\n      background: #f2f2f6;\n      border-radius: 60px;\n    }\n  }\n}\n\n.views-channel-free-tickets-faq-wrapper {\n  box-sizing: border-box;\n  width: 360px;\n\n  .qna {\n    margin-bottom: 20px;\n\n    &:last-child {\n      margin: 0;\n    }\n  }\n\n  .question {\n    margin-bottom: 8px;\n    font-size: 16px;\n    font-weight: 600;\n    line-height: 20px;\n    color: $color-text;\n  }\n\n  .answer {\n    font-size: 14px;\n    line-height: 21px;\n    color: rgba($color: #757575, $alpha: .8);\n  }\n}\n\n.dark-mode {\n  .views-channel-free-tickets-icon {\n    .claimable-count {\n      border: none;\n    }\n  }\n\n  .views-channel-free-tickets-popover-wrapper {\n    .header-container {\n      border-bottom-color: $dm-color-border;\n\n      .title {\n        color: $dm-color-text;\n      }\n\n      .components-icon {\n        color: $dm-color-text;\n      }\n    }\n\n    .box-wrapper {\n      .label-tickets {\n        color: $dm-color-text-secondary;\n      }\n\n      .box-button-disabled {\n        color: $dm-color-button-disabled;\n        background-color: $dm-color-button-disabled-bg;\n      }\n    }\n  }\n\n  .views-channel-free-tickets-faq-wrapper {\n    .question {\n      color: $dm-color-text;\n    }\n\n    .answer {\n      color: $dm-color-text-secondary;\n    }\n  }\n}\n", "// light mode\n// color\n$color-primary: #ffba00;\n$color-text: #16181a;\n$color-text-secondary: rgba($color-text, .45);\n$color-disable: #c6cbd8;\n$color-border: #edeff7;\n$color-red: #ef3d48;\n$color-success: #16bc8b;\n\n// gradient\n$gradient-yellow: linear-gradient(265deg, #ffa900 0%, #ffba00 100%);\n$gradient-red: linear-gradient(-180deg, #ff4d58 0%, #e5202c 100%);\n\n// font\n$font-amount: 'Agency FB', 'Open Sans';\n$font-agency-fb: 'Agency FB', 'Open Sans', amiri, arial, helvetica, 'Droid Sans', system-ui, -apple-system, blinkmacsystemfont, 'Helvetica Neue', sans-serif;\n\n// z-index\n$z-report-dialog: 3000;\n$z-staff-dialog: 3000;\n$z-playback-panel-more-popover: 1002;\n$z-xman-dialog: 2000;\n$z-toast: 1002;\n$z-dialog: 1001;\n$z-popover: 1000;\n$z-spinner: 999;\n$z-dropdown-popover: 998;\n$z-side-nav: 200;\n$z-video-poster-tag: 100;\n$z-header: 997;\n\n// width\n$mobile-modal-width: 310px; //iphone5 and motoG4 width is 320, 10px margin\n$content-max-width: 1200px;\n$content-min-width: 1024px;\n\n// dark mode\n// https://app.sympli.io/app#!/designs/6081507cf475fb47060cf69e/specs/assets\n// color\n$dm-color-text: #e8e8f0;\n$dm-color-text-secondary: #adadba;\n$dm-color-border: #242428;\n$dm-color-border-light: #47474a;\n$dm-color-icon: #5e5e68;\n$dm-color-popover-icon: #81818d;\n$dm-color-button-disabled: rgba(#fff, .25);\n$dm-color-scrollbar: #404046;\n\n// bg colors\n$dm-color-bg-1: #101012; // most dark\n$dm-color-bg-2: #19191d;\n$dm-color-modal-bg: #1e1e25;\n$dm-color-input-bg: #25252b;\n$dm-color-modal-input-bg: #292930;\n$dm-color-button-bg: #303034;\n$dm-color-button-hover-bg: #38383e; // least dark\n$dm-color-button-disabled-bg: #26262b;\n\n// box-shadow\n$dm-box-shadow-modal: 0 0 48px 0 rgba(#000, .11);\n"]
